import { Container, Row, Col } from "react-bootstrap"

const Footer = () => {
    const currentYear = new Data().getFullYear()
    return (
        <footer>
            <Container>
                <Row>
                    <Col className='text-center py-3'>
                    <p>ProShop &copy; {currentYear}</p>
                    </Col>
                </Row>
            </Container>
        </footer>
  )
}

export default Footer
